#add text
PNE_menu.2.name:0 "Добавление текста"
PNE_menu.2.desc:0 "Обратите внимание, что имя планеты изменилось на <PNE>? Не беспокойтесь, старое имя сохранено в строке «Сохраненное первоначальное имя». Теперь вы можете изменить имя планеты стандартным способом (кликнув по имени в левом верхнем углу окна просмотра планеты). После этого нажмите кнопку «Добавить текст». Если вы вернетесь в основное меню не добавив текст, будут автоматически возвращено имя из строки «Текущее имя».\n\n$PNE_menu_status_Text_Adder$"
