#color code
PNE_menu.4.name:0 "Изменение цвета"
PNE_menu.4.desc:0 "Можно изменить цвет каждой буквы. Если вы хотите оставить часть текста белой, вам нужно перекрасить эту часть в белый цвет.\n\nПример: §WЗ§Rемл§!я§!\nДобавьте в пустую строку букву \"З\" и покрасьте ее в белый цвет. Добавьте в конец строки буквы \"емл\" и перекрасьте слово \"Земл\" в красный цвет. Буква \"З\" ранее была покрашена в белый цвет и поэтому останется белой. Теперь добавьте букву \"я\" в конец строки и покрасьте ее в красный цвет.\n\n$PNE_menu_status$"

